- input: TEXT,SB23,SB23.4685,In response to FEC ltr of 12/19/02 we have filed this
    amended report.  The contributions that were posted as returns in the post general
    report did not show on the FEC upload because they were negative numbers.  The
    negative totals were reflected on the filed FEC report but the detailed individual
    entries did not upload.  This will be corrected by going to 'Itemization' then
    indicating 'Itemize' on each of these entries on the amended Post General Report
    that will be filed next week.  Jim Krebs explained (1/2/03) how to correct this
    report concerning the State and District of candiates and these have been corrected
    on this amendment.  We would have filed the amended reports sooner but had difficulties
    reaching FEC personnel during this holiday season.  A message I left for someone
    to return my call apparently was lost or ignored.    Jim Horn   0 1/02/2003
